import React, { Component } from "react";

export class AllBoards extends Component {
	componentDidMount = () => {
		fetch('https://api.trello.com/1/actions/{id}', {
  method: 'GET'
})
  .then(response => {
    console.log(
      `Response: ${response.status} ${response.statusText}`
    );
    return response.text();
  })
  .then(text => console.log(text))
  .catch(err => console.error(err));
	};

	render() {
		return (
			<div className=" col-span-3 bg-red-500 flex items-start my-10 ">
				<div className="bg-yellow-500 p-3 w-1/5 mx-1 h-20 mx-4 my-4 text-white font-bold">
					hacker rank
				</div>
			</div>
		);
	}
}

export default AllBoards;
